import sympy
class Calculator:
    # Associate to each operator its precedence value
    OPERATORS  = { "+": 0, "-": 0, "*": 1, "/": 1, "^":2, "(": 3, ")": 3}

    def __init__ (self):
        self.stack = []

    def push(self, p):
        if p in ['+', '-', '*', '/', '^']:
            op1 = self.stack.pop()
            op2 = self.stack.pop()
            self.stack.append ('(%s %s %s)' % (op1, p, op2) )
        elif p == '!':
            op = self.stack.pop()
            self.stack.append ('%s!' % (op) )
        elif p in ['sin', 'cos', 'tan']:
            op = self.stack.pop()
            self.stack.append('%s(%s)' % (p, op) )
        else:
            self.stack.append(p)

    def convert(self, l):
        l.reverse()
        for e in l:
            self.push(e)
        return self.stack.pop()

    @staticmethod
    def infix_prefix(tokens):
        operandStack = deque()
        operatorStack = deque()

        if len(tokens) == 1: return tokens

        for token in tokens:
            # if token is an operator 
            # => push it onto the operand stack
            if not(token in Calculator.OPERATORS):
                operandStack.append(token)

            # if token is a left parentheses or operator of lower priority than the last, or the operator stack is empty,
            # => push it onto the operator stack
            elif token == '(' or (len(operatorStack) == 0) or Calculator.OPERATORS[operatorStack[-1]] < Calculator.OPERATORS[token]:
                operatorStack.append(token)

            # if token is right parentheses
            elif token == ')':
                # Continue to pop operator and operand stacks, building 
                # prefix expressions until left parentheses is found. 
                # Each prefix expression is push back onto the operand 
                # stack as either a left or right operand for the next operator. 
                while operatorStack[-1] != '(':
                    operator = operatorStack.pop() 
                    rightOperand = operandStack.pop() 
                    leftOperand = operandStack.pop() 
                    operandStack.append([operator, leftOperand, rightOperand])
        
                # Pop the left parentheses from the operator stack. 
                operatorStack.pop()

            # if hierarchy of token is less than or equal to hierarchy of top of the operator stack )
            elif Calculator.OPERATORS[operatorStack[-1]] >= Calculator.OPERATORS[token]:
                # Continue to pop operator and operand stack, building prefix 
                # expressions until the stack is empty or until an operator at 
                # the top of the operator stack has a lower hierarchy than that of the token. 
                while operatorStack and Calculator.OPERATORS[operatorStack[-1]] >= Calculator.OPERATORS[token]: 
                    operator = operatorStack.pop() 
                    rightOperand = operandStack.pop() 
                    leftOperand = operandStack.pop()                     
                    operandStack.append([operator, leftOperand, rightOperand])
        
                # Push the lower precedence operator onto the stack 
                operatorStack.append(token)

        # If the stack is not empty, continue to pop operator and operand stacks 
        # building prefix expressions until the operator stack is empty. 
        while operatorStack:
            operator = operatorStack.pop() 
            rightOperand = operandStack.pop() 
            leftOperand = operandStack.pop() 
            operandStack.append([operator, leftOperand, rightOperand])

        assert(len(operandStack) == 1)
        return operandStack[0]

    def prefix_to_flat(tokens, result):

        for e in tokens:
            # If a token is a list which is not a string
            if type(e) is list and not(type(e) is str):
                # Add parentheses and join the sublist with the main list
                result.append('(')
                #result.extend(Calculator.prefix_to_flat(e))
                Calculator.prefix_to_flat(e, result)
                result.append(')')
                
            # Check if if is the - unary operator
            elif len(e) > 1 and e[0] == '-' and e != "-":
                result.append('(')
                result.append('-')
                result.append(e[1:])
                result.append(')')

            # Else the token is added into the main list
            else:
                result.append(e)

        return result

    def flat_to_string(tokens):
        result = " ".join(tokens)
        result = result.replace("( ", "(").replace(" )", ")")
        return result

    @staticmethod
    def simplify(prefixedExpr):
        c = Calculator()
        # TODO: assume that no more than binary operators
        expr = prefixedExpr.replace("(", "").replace(")", "").split(" ")
        infixedExpr = c.convert(expr)
        simplifiedInfix = "%s" % sympy.simplify(infixedExpr)

        # Add space before and after operators (warning with unary opperator -)
        simplifiedInfix = simplifiedInfix.replace("*", " * ").replace("(", " ( ").replace(")", " ) ")
        simplifiedPrefix = Calculator.infix_prefix(simplifiedInfix.split())
        simplifiedFlat = deque()
        Calculator.prefix_to_flat(simplifiedPrefix, simplifiedFlat)

        return Calculator.flat_to_string(simplifiedPrefix, simplifiedFlat)

    @staticmethod
    def infix_to_prefix(expr):
        result = expr

        # Protect following expressions
        PROTECT = {"62151": ("( -1 )", "(- 1)")}
        for token in PROTECT:
            if PROTECT[token][0] in expr:
                assert(not(token in expr))
                result = expr.replace(PROTECT[token][0] , token)

        # Add spaces before and after each operator
        for op in Calculator.OPERATORS:
            if op in result:
                result = result.replace(op, " " + op + " ")
        result = result.replace("  ", " ")
        infixed = [e for e in result.split(" ") if len(e) > 0]

        # Add a multiplication operator between consecutive operands
        infixedCompleted  = []
        previousIsOperand = False
        for token in infixed:
            if previousIsOperand:
                if not(token in Calculator.OPERATORS):
                    infixedCompleted.append("*")
            infixedCompleted.append(token)
            previousIsOperand = not(token in Calculator.OPERATORS)

        # Compute prefix notation
        prefix = Calculator.infix_prefix(infixedCompleted)
        result = deque()
        Calculator.flat_to_string(Calculator.prefix_to_flat(prefix, result))

        # Reset proteced tokens
        for token in PROTECT:
            if token in result:
                result = result.replace(token, PROTECT[token][1])
        return result


